import { Container, TextField, Typography } from "@mui/material";
import React from "react";

const Todolist = () => {
  return (
    <Container>
      <Typography variant="h3" component="h3" color="primary">
        Todo List
      </Typography>
      <form>
        <TextField variant="outlined" id="Name" label="Name" />
      </form>
    </Container>
  );
};

export default Todolist;
